/**
 * Represents the customer information from the checkout form.
 */
export class Customer {
    id: number = 0; // Assuming your backend might create an ID
    firstName: string = '';
    lastName: string = '';
    email: string = '';
    // Add other fields like address, phone if your form needs them
}
